import { LiveBarChart } from 'react-dynamic-charts';
import 'react-dynamic-charts/dist/index.css'; // Don't forget to import the styles

function App() {
  state = {
    data: [
      {
        "name": "Round 1",
        "values": [
          {
            "id": 1,
            "label": "Test 1",
            "value": 0,
            "color": "red"
          },
          {
            "id": 2,
            "label": "Test 2",
            "value": 0,
            "color": ["yellow", "green"]
          }
        ]
      },
      {
        "name": "Round 2",
        "values": [
          {
            "id": 1,
            "label": "Test 1",
            "value": 10,
            "color": "red"
          },
          {
            "id": 2,
            "label": "Test 2",
            "value": 5,
            "color": ["yellow", "green"]
          }
        ]
      },
      {
        "name": "Round 3",
        "values": [
          {
            "id": 1,
            "label": "Test 1",
            "value": 12,
            "color": "red"
          },
          {
            "id": 2,
            "label": "Test 2",
            "value": 21,
            "color": ["yellow", "green"]
          }
    ]
  }
  ]
  };
  return (
    <div className="App">
      <LiveBarChart
        data={this.state.data}
      />
    </div>
  );
}

export default App;
